query FairBoothHeaderTestsQuery {
  show(id: "anderson-fine-art-gallery-flickinger-collection") {
    ...FairBoothHeader_show
    __id
  }
}

fragment FairBoothHeader_show on Show {
  fair {
    name
    __id
  }
  partner {
    __typename
    ... on Partner {
      name
      id
      href
    }
    ... on ExternalPartner {
      name
      id
      __id
    }
    ... on Node {
      __id
    }
  }
  counts {
    artworks
    artists
  }
  __id
}
